
--     We use transaction to :
--         1. make bookings(inside makeBooking function)
--         2. modify journey time
--         3. alter table Member (add columns hash_password and hash_salt)
--         4. adjust bookings (There ware some journeys such that nbooked > vehicle's capacity)
--         5. grant privilege   -- Atomicity: all or none
--
--     We have done 2 extensions:
--         1. We implement 2 method of pageview:
--              1. One is limit the results getting from database, which is useful for big data set,
--              because it only gets data showing on current page.
--              We use the first method for getting events list.
--              2. The other one is by using javascript and jinja2, which is useful for small data set,
--              because it requires all data at once. The user experience of this method is better.
--              We use the second method for getting journeys list.
--         2. We implement hash ecryption(sha256) for password.

--==========================================================================================================


--- avoid nbooked > capacity
DO $$
BEGIN
    DECLARE
        shouldContinueLoop BOOLEAN;
        j_id INT;
        more INT;
    BEGIN
        shouldContinueLoop := TRUE;
        LOOP
            shouldContinueLoop := EXISTS(
                SELECT 1
                FROM journey NATURAL JOIN vehicle
                WHERE nbooked>vehicle.capacity
            );
            IF (shouldContinueLoop = FALSE ) THEN
                EXIT;
            END IF;
            j_id = (
                SELECT journey_id
                FROM journey NATURAL JOIN vehicle
                WHERE nbooked>vehicle.capacity
                LIMIT 1
            );
            more = (
                SELECT nbooked-capacity
                FROM journey NATURAL JOIN vehicle
                WHERE j_id = journey_id
            );
                DELETE FROM booking
                WHERE journey_id = j_id AND booked_for IN (
                    SELECT booked_for
                    FROM booking
                    WHERE journey_id = j_id
                    LIMIT more
                );
                UPDATE journey
                SET nbooked = nbooked - more
                WHERE journey_id = j_id;
        END LOOP;
    END;
END; $$;

