  CREATE OR REPLACE FUNCTION public.accommodationdetails(IN input_id character)
  RETURNS TABLE(place_name character varying, address character varying, gps_long real, gps_lat real) AS
$BODY$
BEGIN
  RETURN QUERY(
    SELECT P1.place_name, P1.address, P1.gps_long, P1.gps_lat
    FROM Member M1 JOIN Accommodation A1 ON (accommodation = place_id) NATURAL JOIN Place P1
    WHERE member_id = input_id
);
END;
$BODY$
  LANGUAGE plpgsql SECURITY DEFINER;

