  CREATE OR REPLACE FUNCTION public.athletedetails(IN input_id character)
  RETURNS TABLE(events bigint, gold bigint, silver bigint, bronze bigint) AS
$BODY$
BEGIN
  RETURN QUERY(
    SELECT (
      SELECT COUNT(*)
      FROM participates
      WHERE athlete_id = input_id
    ),(
      SELECT COUNT(*)
      FROM Team NATURAL JOIN Teammember
      WHERE athlete_id = input_id AND medal = 'G'
    )+(
      SELECT COUNT(*)
      FROM participates
      WHERE athlete_id = input_id AND medal = 'G'
    ),(
      SELECT COUNT(*)
      FROM Team NATURAL JOIN Teammember
      WHERE athlete_id = input_id AND medal = 'S'
    )+(
      SELECT COUNT(*)
      FROM participates
      WHERE athlete_id = input_id AND medal = 'S'
    ),(
      SELECT COUNT(*)
      FROM participates
      WHERE athlete_id = input_id AND medal = 'B'
    )+(
      SELECT COUNT(*)
      FROM Team NATURAL JOIN Teammember
      WHERE athlete_id = input_id AND medal = 'B'
    )
  );
END;
$BODY$
  LANGUAGE plpgsql SECURITY DEFINER;

