--get bookings with details

  CREATE OR REPLACE FUNCTION public.bookingswdetails(
    IN b_date character varying,
    IN vehicle character varying
  )
  RETURNS TABLE(vehicle_code character, depart_date text, depart_time text, place_from character varying, place_to character varying, booked_by text, when_booked text) AS
$BODY$
BEGIN
  RETURN QUERY(
    SELECT J.vehicle_code,
        to_char(J.depart_time::timestamp::date, 'YYYY-MM-DD'),
        to_char(J.depart_time::timestamp::time, 'HH24:MI:SS'),
        P2.place_name, P1.place_name, M.given_names||' '|| M.family_name,
        to_char(B.when_booked,'YYYY-MM-DD HH24:MI:SS')
    FROM Booking B JOIN Member M ON (M.member_id = B.booked_by) NATURAL JOIN Journey J JOIN Place P1 ON(J.from_place = P1.place_id) JOIN Place P2 ON(J.to_place = P2.place_id)
    WHERE J.depart_time = b_date::timestamp  AND J.vehicle_code = vehicle
);
END;
$BODY$
  LANGUAGE plpgsql SECURITY DEFINER;

