  CREATE OR REPLACE FUNCTION public.getallevents(
    IN currentpage integer,
    IN lim integer)
  RETURNS TABLE(event_gender character, event_name character varying, start timestamp without time zone, sport_name character varying, venue_name character varying, eventid integer, discipline character varying) AS
$BODY$
BEGIN
  RETURN QUERY(
		SELECT E.event_gender, E.event_name, E.event_start, S.sport_name, P.place_name, E.event_id, S.discipline
		FROM Event E JOIN Sport S ON (E.sport_id = S.sport_id) JOIN  Place P ON (E.sport_venue = P.place_id)
		ORDER BY E.event_start ASC
		LIMIT lim
		OFFSET (currentpage * lim)
	);
END;
$BODY$
  LANGUAGE plpgsql SECURITY DEFINER;

--==========================================================================================================

  CREATE OR REPLACE FUNCTION public.getalleventsbymemid(
    IN memid character varying,
    IN currentpage integer,
    IN lim integer)
  RETURNS TABLE(event_gender character, event_name character varying, start timestamp without time zone, sport_name character varying, venue_name character varying, eventid integer, discipline character varying) AS
$BODY$
BEGIN
  RETURN QUERY(
		SELECT E.event_gender, E.event_name, E.event_start, S.sport_name, P.place_name, E.event_id, S.discipline
		FROM Event E JOIN Sport S ON (E.sport_id = S.sport_id) JOIN
		Place P ON (E.sport_venue = P.place_id)
		WHERE EXISTS (
			SELECT 1
			FROM Participates P1
			WHERE memid = P1.athlete_id
			AND E.event_id = P1.event_id
		) OR EXISTS (
			SELECT 1
			FROM TeamMember TM
			WHERE memid = TM.athlete_id
			AND E.event_id = TM.event_id
		)
		ORDER BY E.event_start ASC
		LIMIT lim
		OFFSET (currentpage * lim)
	);
END;
$BODY$
  LANGUAGE plpgsql SECURITY DEFINER;

