  CREATE function getjourneys(place1 character varying, place2 character varying) returns TABLE(
    vehicle character,
    my_day date, my_hour integer, placename1 character varying, placename2 character varying, nbooked integer,
    v_capacity integer, j_id INTEGER)
AS $$
BEGIN
    RETURN QUERY (
        --place to place
        SELECT vehicle_code, DATE(journey.depart_time) AS journey_date, extract(HOUR FROM depart_time)::INT,
            place1,
            place2,
            journey.nbooked,
            (
                SELECT capacity
                FROM vehicle
                WHERE vehicle.vehicle_code = journey.vehicle_code
            ) as v_capacity,
            journey.journey_id
        FROM journey
            JOIN place P1 ON (journey.from_place = P1.place_id)
            JOIN place P2 ON (journey.to_place = P2.place_id)
        WHERE (P1.place_name = place1) AND (P2.place_name = place2)

        UNION
        --place/location to place/location
        SELECT vehicle_code, DATE(journey.depart_time) AS journey_date, extract(HOUR FROM depart_time)::INT,
            (SELECT place_name FROM place WHERE place_id = journey.from_place),
            (SELECT place_name FROM place WHERE place_id = journey.to_place),
            journey.nbooked,
            (
                SELECT capacity
                FROM vehicle
                WHERE vehicle.vehicle_code = journey.vehicle_code
            ) as v_capacity,
            journey.journey_id
        FROM journey
            JOIN place_locate P1 ON (P1.place_id = journey.from_place AND P1.location_name = place1)
            JOIN place_locate P2 ON (P2.place_id = journey.to_place AND P2.location_name = place2)
    );
END;
$$
    LANGUAGE plpgsql SECURITY  DEFINER ;

