  CREATE OR REPLACE FUNCTION public.getmedalsformembersofevent(IN eventid integer)
  RETURNS TABLE(athlete_id character, medaltype character, points integer) AS
$BODY$
BEGIN
	RETURN QUERY(
	(
		SELECT P.athlete_id as name, P.medal,
		CASE WHEN medal = 'G' THEN 10
		     WHEN medal = 'S' THEN 8
		     WHEN medal = 'B' THEN 5
		     ELSE 4
		END as points
		FROM Participates P
		WHERE event_id = eventid
	) UNION (
		SELECT T.team_name as name, T.medal,
		CASE WHEN medal = 'G' THEN 10
		     WHEN medal = 'S' THEN 8
		     WHEN medal = 'B' THEN 5
		     ELSE 4
		END as points
		FROM Team T
		WHERE T.event_id = eventid
	) ORDER BY points DESC, name ASC
	);
END;
$BODY$
  LANGUAGE plpgsql SECURITY DEFINER;

