  CREATE OR REPLACE FUNCTION public.makebooking(
    my_member_id character,
    for_member character,
    my_vehicle character,
    my_date date,
    my_hour integer,
    start_destination_name character varying,
    end_destination_name character varying)
  RETURNS integer AS
$BODY$
DECLARE
    correspondingJourney BOOLEAN;
    correspondingJourneyID INT;
    availableVehicle BOOLEAN;
    start_destination INT;
    end_destination INT;
    flag BOOLEAN;
BEGIN
    --NOT A STAFF
    start_destination := (SELECT place_id FROM place WHERE place_name = start_destination_name);
    end_destination := (SELECT place_id FROM place WHERE place_name = end_destination_name);
    IF (my_member_id = for_member) THEN
        --RAISE NOTICE '-----ERROR1-1----';
         RETURN -1;
    ELSIF (start_destination = end_destination) THEN
        --RAISE NOTICE '-----ERROR1-2----';
         RETURN -2;
    ELSIF (NOT EXISTS(SELECT 1 FROM staff WHERE member_id = my_member_id)) THEN
        --RAISE NOTICE '-----ERROR1-3----';
         RETURN -3;
    ELSIF (NOT EXISTS(SELECT 1 FROM member WHERE member_id = for_member)) THEN
        --RAISE NOTICE '-----ERROR1-4----';
         RETURN -4;
    ELSEIF (NOT EXISTS(SELECT 1 FROM place WHERE place_id = start_destination)) THEN
        --RAISE NOTICE '-----ERROR1-5----';
         RETURN -5;
    ELSEIF (NOT EXISTS(SELECT 1 FROM place WHERE place_id = end_destination)) THEN
        --RAISE NOTICE '-----ERROR1-6----';
         RETURN -6;
    ELSIF -- This member has booked a journey at this time
        (EXISTS(
            SELECT 1
            FROM booking NATURAL JOIN  journey
            WHERE booked_for = for_member AND
                DATE(depart_time) = my_date AND
                EXTRACT(HOUR FROM depart_time) = my_hour
        )) THEN
        --RAISE NOTICE '-----ERROR1-7----';
         RETURN -7;
    ELSE
        correspondingJourney := (EXISTS (
            SELECT 1
            FROM (Journey NATURAL JOIN vehicle V) J
			WHERE DATE(J.depart_time) = my_date AND
                EXTRACT(HOUR FROM J.depart_time) = my_hour AND
				J.from_place = start_destination AND
				J.to_place = end_destination AND
                J.vehicle_code = my_vehicle AND
                J.nbooked < J.capacity
        ));
        IF (correspondingJourney) THEN
            correspondingJourneyID := (
                SELECT journey_id
                FROM (Journey NATURAL JOIN vehicle V) J
			    WHERE DATE(J.depart_time) = my_date AND
                    EXTRACT(HOUR FROM J.depart_time) = my_hour AND
				    J.from_place = start_destination AND
				    J.to_place = end_destination AND
                    J.vehicle_code = my_vehicle AND
                    J.nbooked < J.capacity
            );
            --START TRANSACTION;
            --RAISE NOTICE '-----START1----';

            INSERT INTO booking(booked_for, booked_by, when_booked, journey_id)
                VALUES (for_member, my_member_id, CURRENT_TIMESTAMP, correspondingJourneyID);
            UPDATE journey
                SET nbooked = nbooked + 1
                WHERE journey_id = correspondingJourneyID;
            --COMMIT;
            --RAISE NOTICE '-----SUCEED1----';
             RETURN 1;
        ELSE
            -- FIND Vehicle
            availableVehicle := NOT EXISTS(
                    --The vehicle is not available at that time
                    SELECT 1 FROM Journey J
                    WHERE J.vehicle_code = my_vehicle AND
                        (DATE(J.depart_time) = my_date) AND (
                        (EXTRACT(HOUR FROM J.depart_time) = my_hour)
                    )
                )
            ;

            if (availableVehicle) THEN
                correspondingJourneyID = 1 + (
                    SELECT COALESCE(MAX(journey_id), 0)
                    FROM journey
                );
                INSERT INTO journey(journey_id, depart_time, from_place, to_place, vehicle_code, nbooked)
                    VALUES (correspondingJourneyID, my_date + my_hour * INTERVAL'1 hour', start_destination, end_destination, my_vehicle, 1);
                INSERT INTO booking(booked_for, booked_by, when_booked, journey_id)
                    VALUES (for_member, my_member_id, CURRENT_TIMESTAMP, correspondingJourneyID);
                --RAISE NOTICE '-----SUCEED2----';
                 RETURN 2;
            ELSE
                --RAISE NOTICE '-----ERROR2----';
                 RETURN -8; -- vehicle is not available / no time or no seat
            END IF;
        END IF;
    END IF;

END;
$BODY$
  LANGUAGE plpgsql SECURITY DEFINER;

