  CREATE OR REPLACE FUNCTION public.memberdetails(IN input_id character)
  RETURNS TABLE(member_id character, title character varying, given_names character varying, family_name character varying, country_name character varying, accommodation_name character varying, member_type character varying) AS
$BODY$
BEGIN
  RETURN QUERY(
        SELECT M1.member_id, M1.title, M1.given_names, M1.family_name, C1.country_name, M1.place_name,
            cast( (CASE
                WHEN EXISTS(SELECT 1 FROM athlete A WHERE A.member_id = input_id) THEN 'athlete'
                WHEN EXISTS(SELECT 1 FROM staff A WHERE A.member_id = input_id) THEN 'staff'
                WHEN EXISTS(SELECT 1 FROM official A  WHERE A.member_id = input_id) THEN 'official'
                ELSE 'member'
            END) AS VARCHAR(10))
        FROM (member M11 JOIN place P11 ON (M11.accommodation = P11.place_id)) M1, country C1
        WHERE M1.member_id = input_id AND C1.country_code = M1.country_code
        );
END;
$BODY$
  LANGUAGE plpgsql SECURITY DEFINER;

