  CREATE OR REPLACE VIEW location_locate AS (
    WITH RECURSIVE location_locate(location_id, located_in) AS (
    (
        SELECT location_id, part_of
        FROM location
    )
    UNION
    (
        SELECT A.location_id, B.part_of
        FROM location_locate A JOIN location B ON (A.located_in = B.location_id)
        --WHERE P.located_in IS NOT NULL
    )
    )
    SELECT L1.location_id AS location_id,
        L2.location_id AS locate_in,
        L1.name AS location_name,
        l2.name AS located_in_name
    FROM location_locate JOIN location L1 USING (location_id)
        JOIN location L2 ON(located_in = L2.location_id)
 );



--==========================================================================================================

  CREATE OR REPLACE VIEW place_locate AS (
    SELECT place_id, L1.location_id AS location_id, place_name, L1.name AS location_name
    FROM place JOIN location_locate ON (place.located_in = location_locate.location_id)
    JOIN location L1 ON (location_locate.locate_in = L1.location_id)
    UNION
    SELECT place_id, located_in AS location_id, place_name, L1.name AS location_name
    FROM place JOIN location L1 ON (place.located_in = L1.location_id)
);

